import React from 'react';


export default function Table ({ data }) {
  const columns = [
    { title: 'in_frame', field: 'in_frame' },
    { title: 'out_frame', field: 'out_frame' },
    { title: 'value', filed: 'value' },
    { title: 'labels', field: 'labels' },
    { title: 'location', field: 'location' },
  ];

  return (
    <table>
      <caption>Graphics Markup Data</caption>
      <thead>
        <tr>
          {columns.map(({ title }) => <th>{title}</th>)}
        </tr>
      </thead>
      <tbody>
        {data && data.map(({ in_frame, out_frame, value, lables, location }) => (
          <tr>
            <td>{in_frame}</td>
            <td>{out_frame}</td>
            <td>{value}</td>
            <td>{lables}</td>
            <td>{location}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
